import React, { Component } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Landing from "./components/layout/Landing";

class App extends Component {
  render() {
    return (
      <BrowserRouter>
      <Routes>
          <Route path="/" exact component={Landing} />
        </Routes>
      </BrowserRouter>
    );
  }
}
export default App;
